Необходимо создать web-интерфейс для пользователя для этого кода, чтобы освободить пользователя от усилий программиста по заданию начальных данных для этого кода.
Так же эти матрицы и формы элементов надо будет визуализировать.', 32, 0, 0, 3, NULL, NULL, NULL, CAST(N'2020-12-15T16:49:15.600' AS DateTime), CAST(N'2020-12-15T17:13:14.000' AS DateTime), NULL)
