- автоматизация проверки результатов работы: от электронных учебников до проверки созданных файлов;
- программирование в рамках ЭИОС БГТУ (система Moodle).', 37, 0, 0, 3, NULL, NULL, NULL, CAST(N'2020-12-15T17:03:24.423' AS DateTime), NULL, NULL)
