info : {
	Существует программный комплекс "Универсальный механизм" (УМ), разработанный в БГТУ. Он имеет богатый визуальный пользовательский интерфейс, однако сложную структуру описания исходных данных.
Существует особый способ очень краткого символьного описания произвольной системы, буквально путём ввода нескольких символов для каждого аспекта описания. Например, zi описывает плоский маятник, изначально расположенный горизонтально. Существует также конвертор из короткого описания в формат УМ, написанный на Delphi (описание данной модели в УМ содержит примерно 10 строк текста).
Необходимо дать web-пользователю доступ к полной мощности пакета УМ путём ввода краткой формы описания модели, с последующим запуском УМ и визуализацией результатов работы.
